import "../styles/board.css";
import { CreateBoard } from "./CreateBoard";
import { Sudoku } from "./Sudoku";

export type Board = {
  num: number;
  box: number;
  row: number;
  col: number;
};

export default function TestBoard() {
  const colors = [
    "#DAB49D",
    "#F29559",
    "#F2D492",
    "#A9C5A0",
    "#9DCBBA",
    "#779FA1",
    "#92817A",
    "#979B8D",
    "#F1DABF", //#DAB49D pink
  ];

  let N = 9;
  let K = 40;
  let sudoku = new Sudoku(N, K);
  sudoku.fillValues();
  console.log(sudoku.mat);

  return (
    <div className="board">
      {sudoku.mat.map((box: number[], index: number) => (
        <div className="cell-item">{box[0]}</div>
      ))}
      <div className="cell-item"></div>
    </div>
  );
}
